Обелиск на месте дуэли (скульптор Б. М. Микешин) - бульвар Гагарина (N44 3.543,  
E43 4.624);

Памятник на месте первоначального погребения поэта - ул. Крайнего;

Академическая галерея - упомянута в романе «Герой нашего времени» - бульвар Гагарина;

Беседка «Эолова арфа» (1830—1831) - упоминается в романе «Герой нашего времени», Грот Лермонтова - здесь поэт любил отдыхать - бульвар Гагарина

"Ресторация" (1825) – одно из старейших зданий Пятигорска, здесь бывал Лермонтов - ул. Анджиевского

Адрес: г. Пятигорск
